import React from "react";
import "./Footer.css";
import Wave from "../../img/wave.png";
import Insta from "@iconscout/react-unicons/icons/uil-instagram";
import Facebook from "@iconscout/react-unicons/icons/uil-facebook";
import Gitub from "@iconscout/react-unicons/icons/uil-github";

const Footer = () => {
  return (
    <div className="footer">
      <img src={Wave} alt="" style={{ width: "100%" }} />
      <div className="f-content">
        <span>Zainkeepscode@gmail.com</span>
        <div className="f-icons">
          <Insta color="white" size={"3rem"} />
          <Facebook color="white" size={"3rem"} />
          <Gitub color="white" size={"3rem"} />
        </div>
      </div>
      <div class="box">
          <h3>contact info</h3>
          <p> <i class="fas fa-phone"></i>+91 304-6413094</p>
          <p> <i class="fas fa-envelope"></i>sho03046413094@gmail.com</p>
          <p> <i class="fas fa-map-marked-alt"></i>Pakistan, Punjab</p>
          <div class="share">

              <a href="https://www.linkedin.com/in/m-ali-158284245/" class="fab fa-linkedin" aria-label="LinkedIn" target="_blank"></a>
              <a href="https://github.com/Shoaib11229900" class="fab fa-github" aria-label="GitHub" target="_blank"></a>
              <a href="mailto:sho03046413094@gmail.com" class="fas fa-envelope" aria-label="Mail" target="_blank"></a>
              <a href="https://twitter.com/ShoaibA68349714" class="fab fa-twitter" aria-label="Twitter" target="_blank"></a>
          </div>
      </div>
    </div>
  );
};

export default Footer;
